/* eslint-disable no-unused-expressions */
/* eslint-disable no-sequences */
import React,{useState,useEffect} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import './PeopleList.css'

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

// function createData(name, calories, fat, carbs, protein) {
//   return { name, calories, fat, carbs, protein };
// }

// const manager = [
//   createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
//   createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
//   createData('Eclair', 262, 16.0, 24, 6.0),
//   createData('Cupcake', 305, 3.7, 67, 4.3),
//   createData('Gingerbread', 356, 16.0, 49, 3.9),
// ];

// const staff = [
//   createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
//   createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
//   createData('Eclair', 262, 16.0, 24, 6.0),
//   createData('Cupcake', 305, 3.7, 67, 4.3),
//   createData('Gingerbread', 356, 16.0, 49, 3.9),
// ];

const PeopleList = () => {
    const classes = useStyles();

    const [staff, setStaff] = useState({
      staffList: []
    });

    const [manager, setManager] = useState({
      managerList: []
    });

    const getManager = async () => {
      setManager({
        managerList: [{
          fullName: 'manager1',
          email: 'plus@gmail.com',
          mobile: '0451172301'
        }, {
          fullName: 'manager2',
          email: 'plus@gmail.com',
          mobile: '0451172301'
        }]
      })
    }

    const getStaff = async () => {
      setStaff({
        staffList: [{
          fullName: 'staff1',
          limitHours: "40",
          email: 'plus@gmail.com',
          mobile: '0451172301',
          address: '102 box st'
        }, {
          fullName: 'staff2',
          limitHours: "40",
          email: 'plus@gmail.com',
          mobile: '0451172301',
          address: '102 box st'
        }]
      })
    }

    useEffect(() => {
      getManager(),
      getStaff()
    }, [])

    const { staffList } = staff;
    const { managerList } = manager;


  return (
    <>
    <div className="title">Manager</div>
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Full Name</TableCell>
            <TableCell align="right">Email</TableCell>
            <TableCell align="right">Mobile Number</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {managerList.map((row) => (
            <TableRow key={row.fullName}>
              <TableCell component="th" scope="row">
                {row.fullName}
              </TableCell>
              <TableCell align="right">{row.email}</TableCell>
              <TableCell align="right">{row.mobile}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      </TableContainer>
      <div className="title">Staff</div>
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Full Name</TableCell>
            <TableCell align="right">Limit Hours</TableCell>
            <TableCell align="right">Email</TableCell>
            <TableCell align="right">Phone Number</TableCell>
            <TableCell align="right">Home Address</TableCell>
            <TableCell align="right">Action</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {staffList.map((row) => (
            <TableRow key={row.fullName}>
              <TableCell component="th" scope="row">
                {row.fullName}
              </TableCell>
              <TableCell align="right">{row.limitHours}</TableCell>
              <TableCell align="right">{row.email}</TableCell>
              <TableCell align="right">{row.mobile}</TableCell>
              <TableCell align="right">{row.address}</TableCell>
              <TableCell align="right">{row.address}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      </TableContainer>
      </>
  );
}

export default PeopleList;
